Hallo Community,

ich bin der Leiter der Community Fearnixx Gaming und habe es mir vorgenommen f&uuml;r die kommende Season ein RankedTeam zu erstellen.
Ich selber spiele Main Mid und bin 22 jahre alt, hei&szlig;t das ich nat&uuml;rlich nun auf der suche nach einer Botlane, einem Jungler und einer Toplane bin.

Das Ziel ist es als Team sich hoch zu spielen und somit die Ladder zu climben.

Was wird von euch erwartet:
&times; Alter 18+ &times;
&times; Elo min.Silber &times;
&times; Teamspeak 3 &times;
&times; Ausreichend gro&szlig;er Champion Pool &times;
&times; Feste Trainingszeiten &times;
&times; Zuverl&auml;ssig &times;
&times; Kritikf&auml;hig &times;

Wenn ihr Interesse oder Fragen habt meldet euch einfach bei mir : FNG TaganFreez!


Danke f&uuml;r&acute;s lesen

